import React from 'react'

import Navbar from './Navbar';
import Slider from './Slider';
import About from './About';
import List from './List';
const Home = () => {
    return (
        <div>
         <div><Navbar/></div>     
        <div><Slider/></div>
         <div><About/></div>
         <div><List/></div>
        </div>
    )
}

export default Home
